        <Card className={classes.users}>  
            <ul>
                {props.users.map((user) => 
                <li 
                onClick={Delete}
                key={user.id}>
                    {user.name} 
                    ({user.age} Years Old)</li>
                    )}
            </ul>
        </Card>
    )
}

